import React from 'react'



function AddCard({studyDeck}){
  let result
  if(studyDeck!==undefined){
    result=(
      <>
        <div className={"col"}>
          <h3>Not Enough Cards</h3>
        </div>
        <p className={"col"}>You need atleast 3 cards. You have {studyDeck.cards.length} cards.</p>
        <button className={"col-2 btn btn-primary"}>Add Card</button>
      </>
      )
  }
  return result;
}


export default AddCard;
